function data(){
if(new java.io.File(String(android.os.Environment.getExternalStorageDirectory().getAbsolutePath()+"/games/.game/zdyd.txt")).exists()){
if(new java.io.File(String(android.os.Environment.getExternalStorageDirectory().getAbsolutePath()+"/games/.game/zdyd.txt")).isFile()){
var Box=""
var DW=new java.io.InputStreamReader(new java.io.FileInputStream(new java.io.File(String(android.os.Environment.getExternalStorageDirectory().getAbsolutePath()+"/games/.game/zdyd.txt"))))
var SB=null
while((SB=new java.io.BufferedReader(DW).readLine())!=null)
{Box=Box+SB}
DW.close()
return Box
}}
}
